import React, {useState} from 'react'
import {useForm} from 'react-hook-form'


function SearchRepositoryPage() {

    return (<div>

      const { register, handleSubmit } = useForm();
    return (

    <div className = "max-w-sm bg-zinc-800 max-w-md p-10 rounded-md flex justify-center flex-col m-auto h-screen">

            <h1 className="text-white my-2 w-full">Regsitrar Cuenta</h1>

            <form onSubmit={handleSubmit(async (values) => {
                await registerRequest(values); console.log(values);
            })}>
                <input type="text" {...register("username", {required: true})}
                className = "w-full bg-zinc-700 text-white px-4 py-2 rounded-md my-2"
                placeholder='Username'/>
                <input type="text" {...register("name", {required: true})}
                className = "w-full bg-zinc-700 text-white px-4 py-2 rounded-md my-2"
                placeholder='Name'/>      
                <input type="email" {...register("email", {required: true})}
                className = "w-full bg-zinc-700 text-white px-4 py-2 rounded-md my-2"
                placeholder='Email'/>
                <input type="password" {...register("password", {required: true})}
                className = "w-full bg-zinc-700 text-white px-4 py-2 rounded-md my-2"
                placeholder='Password'/>

                <button type="submit" className = "bg-white text-black px-4 py-2 rounded-md my-2">Registrarse</button>
            </form>
        </div>
    )



    </div>);
}

export default SearchRepositoryPage
